import{_ as t,c as o,o as r,ah as a}from"./chunks/framework.PvdZnrZd.js";const g=JSON.parse('{"title":"SQUAREUP CONNECTOR","description":"SQUAREUP CONNECTOR","frontmatter":{"title":"SQUAREUP CONNECTOR","description":"SQUAREUP CONNECTOR","date":"2025-07-20T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/connector/squareup-connector.md","filePath":"zenith/featured-app/connector/squareup-connector.md"}'),n={name:"zenith/featured-app/connector/squareup-connector.md"};function l(s,e,p,i,c,u){return r(),o("div",null,[...e[0]||(e[0]=[a('<p>Square up is now integrated with the <a href="/zenith/introduction/overview.html">Multi-vendor Marketplace</a> app for Shopify. This integration will help your sellers to connect their Square POS to the admin&#39;s Shopify store.</p><p>Thus, the marketplace sellers can manage products, inventory, pricing at a single location.</p><blockquote><p><a href="https://squareup.com/us/en" target="_blank" rel="noreferrer"><strong>Squareup</strong></a> is mainly a Free mobile POS app developed for Android applications. It offers the simplest way to accept credit card payment from customers.</p><p>Thus, the <em>sellers who are selling products using Square POS can connect their stores to the admin&#39;s Shopify store</em>.</p></blockquote><p>With the Squareup connector, sellers selling on Square <strong>POS</strong> can auto-sync their products with the admin&#39;s marketplace.</p><p>Also, the sellers can import their products from Square POS to the admin&#39;s marketplace.</p><p>Accordingly, inventory will be managed at both the ends once an order is created/updated for the seller’s product at Square POS or at Shopify.</p><p>You can enable the <strong>Squareup connector</strong> from the “<strong>Feature App</strong>” section of the app. Then, approve the additional charge of $25 USD/month over and above your current Multi-vendor app plan.</p><p>Let&#39;s explore the connector in detail.</p><h3 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h3><ul><li>Sellers can connect their Square POS to the admin&#39;s Shopify store.</li><li><strong>Auto-Sync</strong> Option:- To sync all the newly added products of the seller&#39;s Squareup store will be auto-synced with the admin&#39;s Shopify store.</li><li>Option to re-sync the products from the product listing section.</li><li>Allow sellers to <strong>create price rules</strong>:- Based on the product price rules created by the seller, the product price of Square up POS will be calculated at the merchant’s store.</li><li>Marketplace sellers can import their Square POS products to the admin&#39;s store.</li><li>The sellers can now have multiple variant options in a product synced from Squareup into the multi-vendor marketplace app.</li></ul><h3 id="how-to-enable-this-feature-app" tabindex="-1">How to enable this feature app? <a class="header-anchor" href="#how-to-enable-this-feature-app" aria-label="Permalink to &quot;How to enable this feature app?&quot;">​</a></h3><p>Go to the Feature app section and enable the Squareup connector feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Home-Admin-1.png" alt="Dashboard"></p><p>Visiting the feature App section, search for the <strong>Squareup Connector</strong> &amp; <strong>enable</strong> the feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-55.png" alt="Squareup"></p><p>Click the <strong>Enable</strong> button.</p><p>This way, you can install the Squareup connector in the app.</p><h3 id="squareup-connector-configuration-admin-end" tabindex="-1">Squareup Connector Configuration: Admin End <a class="header-anchor" href="#squareup-connector-configuration-admin-end" aria-label="Permalink to &quot;Squareup Connector Configuration: Admin End&quot;">​</a></h3><p>After enabling the Squareup feature app, a new menu appears under the <strong>Configuration</strong> menu i.e. <strong>Squareup App Configuration</strong>.</p><p>You need to configure the Squareup app details for the seller&#39;s Squareup store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Dashboard-Admin-5-1200x597.png" alt="squareup"></p><p>Visiting this section, you will get the options to enter the details of the app that you have created on Squareup for your sellers.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Squareup-App-Configuration-Admin-1-1200x867.png" alt="square up configuration"></p><p>Now, in order to let the sellers connect their Squareup stores to your Shopify store, you need to <em><strong>Create an App</strong></em> on Squareup.</p><p>From the app, you will get the credentials that are required to configure the app settings &amp; make things work for the sellers.</p><p>You can create an app on your own or <a href="https://webkul.uvdesk.com/en/customer/create-ticket/" target="_blank" rel="noreferrer"><strong>request</strong></a> to create the app.</p><h3 id="how-to-create-an-app-on-squareup" tabindex="-1">How to Create an App on SquareUp? <a class="header-anchor" href="#how-to-create-an-app-on-squareup" aria-label="Permalink to &quot;How to Create an App on SquareUp?&quot;">​</a></h3><p>You can follow the below-given steps to create an app on Square up:-</p><ul><li>Log in to <a href="https://squareup.com/" target="_blank" rel="noreferrer"><strong>Squareup</strong></a>.</li><li>Go to the <strong>Dashboard</strong> and click on <strong>+</strong> button to add a <strong>New Application</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-1200x627.png" alt="square up portal"></p><ul><li>Now, <strong>enter</strong> the Application Name &amp; click the <strong>Save</strong> button.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-1-1200x627.png" alt="Square-Developer-Portal-1"></p><p>This way, you can create an application on Squareup.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-2-1200x627.png" alt="Square-Developer-Portal-2"></p><p>Now, enable the <strong>Production mode</strong> settings and get the credentials to configure Squareup settings on the multi-vendor app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-3-1057x1024.png" alt="Square-Developer-Portal-3"></p><h2 id="note" tabindex="-1">Note <a class="header-anchor" href="#note" aria-label="Permalink to &quot;Note&quot;">​</a></h2><p>Make sure to change the API Version suggested in the app. You need to click the <strong>Change Version</strong> button &amp; select the version: <strong>(<em>2019-09-25</em>)</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-14-1200x627.png" alt="API version"></p><p>Clicking the version, you can select the version <strong>(<em>2019-09-25</em>)</strong> from the drop-down menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot2-1200x590.png" alt="change API"></p><p>This way, you can end up creating an app on Squareup. Now, you need the app credentials to configure the square up settings for your sellers on the multivendor app.</p><h3 id="how-to-get-the-squareup-app-credentials" tabindex="-1">How to Get the Squareup App Credentials? <a class="header-anchor" href="#how-to-get-the-squareup-app-credentials" aria-label="Permalink to &quot;How to Get the Squareup App Credentials?&quot;">​</a></h3><p>After creating the Squareup app, all the credentials will be available to configure the settings. Let&#39;s see how to get each of them.</p><ol><li><strong>Application ID</strong><br> Go to Dashboard&gt;&gt;Visit Squareup App&gt;&gt;View Details&gt;&gt;<strong>Credentials.</strong></li></ol><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-4-1200x485.png" alt="production app ID"></p><p>2. <strong>Application Secret</strong><br> Go to Developer &gt;&gt;Visit Squareup App&gt;&gt;View Details&gt;&gt;<strong>OAuth</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/04/Square-Developer-Portal-6-1200x627.png" alt="Square-Developer-Portal-6"></p><p>3. <strong>Webhook Signature Key</strong><br> To get the Signature Key, first, you need to create a webhook. Let&#39;s see how to do that.</p><h3 id="why-create-webhook" tabindex="-1">Why Create Webhook? <a class="header-anchor" href="#why-create-webhook" aria-label="Permalink to &quot;Why Create Webhook?&quot;">​</a></h3><p>You need to register a webhook to <strong>get triggered by specific events that occur on the seller&#39;s Square POS</strong>.</p><p>APIs require calls at regular time intervals in order to detect changes in data.</p><p>Thus, <strong>webhook replaces these API calls &amp; provides instant, real-time notification updates on specific events that</strong> occur at the seller end (on Square POS).</p><p>For more details, <a href="https://developer.squareup.com/docs/webhooks-api/what-it-does" target="_blank" rel="noreferrer"><strong>Click here</strong></a></p><p>So, let&#39;s see how to create a webhook.</p><h3 id="how-to-create-webhook" tabindex="-1">How to Create Webhook? <a class="header-anchor" href="#how-to-create-webhook" aria-label="Permalink to &quot;How to Create Webhook?&quot;">​</a></h3><p>Creating a webhook will provide you the signature key to configure the Squareup app details for sellers in the Multi-vendor App. To get the hit, perform the below-given steps &amp; add a webhook:-</p><ul><li>Log in to <strong>Squareup</strong>.</li><li>Visit the <strong>Squareup Dashboard</strong>.</li><li>Go to <strong>Apps</strong>.</li><li>If you have created an app, go to <strong>My Apps</strong>.</li><li>Go to <strong>Developer Dashboard</strong>.</li><li>Click <strong>View Details</strong> of the app you have created.</li><li>You will be redirected to the Credentials section from where you need to visit the <strong>Webhook</strong> section.</li><li><strong>Enable</strong> Webhook.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-5-1200x597.png" alt="webhook"></p><ul><li>Now, proceed to <strong>Connect v2 Webhooks</strong>.</li><li>Click the <strong>Add Endpoint</strong>.</li><li>Here, You need to enter the Webhook <strong>name</strong>, Webhook <strong>Listener URL</strong> (provided in the app), set the <strong>API version (<em>2019-09-25</em>)</strong>.</li><li>Select the two events:-<br><em>catalog.version.updated</em><br><em>inventory.count.updated</em></li><li><strong>Save</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-6-1200x597.png" alt="add endpoint"></p><ul><li>This way, you can end up creating a Webhook. Now, click the <strong>Save</strong> button to save the created Webhook.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-7-1200x627.png" alt="connect v2"></p><p>Thereafter, you will get the <strong>Webhook Signature Key</strong>, required to configure the Squareup details for sellers in the multi-vendor app.</p><p>Click the name of the created Webhook &amp; get the signature key from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-10-1200x627.png" alt="webhook key"></p><p>Get the <strong>Webhook Signature Key</strong> from here.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Square-Developer-Portal-11-1200x627.png" alt="signature key"></p><p>With these details, you can configure the Squareup settings in the app and allow sellers to connect their Squareup shop with the admin&#39;s Shopify store.</p><p>Details Saved Successfully:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Squareup-App-Configuration-Admin-1-1200x627.png" alt="squareup details"></p><p>Now, let&#39;s proceed to check the functionalities on the Seller end.</p><h3 id="squareup-configuration-seller-end" tabindex="-1">Squareup Configuration: Seller End <a class="header-anchor" href="#squareup-configuration-seller-end" aria-label="Permalink to &quot;Squareup Configuration: Seller End&quot;">​</a></h3><p>As soon as the admin enables the Squareup feature, a new sub-menu gets added to the <strong>Configuration</strong> menu of the app i.e. <strong>Squareup Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Dashboard-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="seller end"></p><p>Visting the <strong>Squareup Configuration</strong> menu, firstly, the seller needs to install the Squareup App (that is already developed at the time of integration of Squareup with the Multi-vendor Marketplace app).</p><p>Seller will click the <strong>Download Shopify-Squareup App</strong>. This will redirect the seller to the <a href="https://squareup.com/login" target="_blank" rel="noreferrer">login page of the Squareup</a>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Squareup-Details-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="download app"></p><p>Clicking the above button, the seller will be asked to log in to the Squareup store.</p><p>If already logged in, subsequently, the seller will be redirected to the Squareup permission page. The seller needs to allow access.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-48.png" alt="sign up"></p><p>Now, the seller will log in to his/her Squareup store and allow access.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-by-Lightshot-1-1200x627.png" alt="permission"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-by-Lightshot-1-1-1200x408.png" alt="Allow"></p><p>Coming back to the seller panel, the seller will configure the settings such as enable the <strong>auto-sync option</strong>, change <strong>weight unit</strong>, <strong>map collections</strong>, etc.</p><h2 id="auto-sync-new-products" tabindex="-1">Auto-sync New Products <a class="header-anchor" href="#auto-sync-new-products" aria-label="Permalink to &quot;Auto-sync New Products&quot;">​</a></h2><p>The sellers can enable this option to auto-sync the newly added products to the admin&#39;s Shopify store.</p><p>Moreover, the seller will click the <strong>import products</strong> button to import previously added Squareup store products to the admin&#39;s Shopify store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Squareup-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-1-2.png" alt="configuration details"></p><h3 id="map-collection" tabindex="-1">Map Collection <a class="header-anchor" href="#map-collection" aria-label="Permalink to &quot;Map Collection&quot;">​</a></h3><p>Before the product import, the seller needs to map the admin&#39;s store collection with the collections of his/her Squareup store.</p><p><strong>Note</strong>:- Make sure that the admin has enabled the “<strong>Restrict Collection</strong>” tab from the multi-vendor admin panel.</p><p>For this, the seller will visit the <strong>Map Collection</strong> section and then, select the admin&#39;s collection to map with his/her own Squareup store&#39;s collection.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot-50-1.png" alt="Collection mapping "></p><p>Seller will choose the admin&#39;s store collection &amp; map it with Squareup store&#39;s collection.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Map-Collections-%E2%80%A2-Multivendor-MarketPlace.png" alt="Map Collection"></p><p>Finally, all the mapped collections will be listed like this:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Squareup-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-3-1200x756-png-1200%C3%97756-.png" alt="collection"></p><p>This way, sellers can map collection.</p><h3 id="import-products" tabindex="-1">Import Products <a class="header-anchor" href="#import-products" aria-label="Permalink to &quot;Import Products&quot;">​</a></h3><p>After all these settings, the seller will proceed to import products from his/her Squareup store to the admin&#39;s Shopify store.</p><p>Clicking the <strong>Import Product</strong> button, the seller will enter the <strong>comma-separated product IDs</strong> (that the seller wants to import).</p><p><em><strong>Please note: You can only import</strong></em> <strong>&quot;simple&quot;</strong> <em><strong>and &quot;</strong></em><strong>variable</strong>&quot; <em><strong>products.</strong></em></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Import-Product-From-Squareup-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="import"></p><p>This way, the seller can import Squareup products to the admin&#39;s Shopify store.</p><h2 id="sync-with-seller-s-store" tabindex="-1">Sync with Seller&#39;s Store <a class="header-anchor" href="#sync-with-seller-s-store" aria-label="Permalink to &quot;Sync with Seller&#39;s Store&quot;">​</a></h2><p>In case the products are not synced once you import them, you can visit the seller listing section &amp; sync products with the seller&#39;s store.</p><p>Products&gt;&gt;&gt;<strong>Product Listing</strong>&gt;&gt;&gt;<strong>Action</strong> menu&gt;&gt;&gt;Click &quot;<strong>Sync with seller store</strong>&quot; button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Product-Admin-2.png" alt="sync with seller&#39;s store"></p><p>After that, all the imported products will be listed in the &quot;<strong>Approval Pending state</strong>&quot;. Thus, the admin needs to approve them from the product listing section of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Product-Admin-1.png" alt="enable sync "></p><h3 id="create-price-rule" tabindex="-1">Create Price Rule <a class="header-anchor" href="#create-price-rule" aria-label="Permalink to &quot;Create Price Rule&quot;">​</a></h3><p>Let the sellers create price rules to manage the product price of the seller&#39;s Square up POS to the merchant’s store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Dashboard-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1200x627.png" alt="configure"></p><p>Sellers will have a new menu named <strong>Connector Price Rule</strong> in the configuration menu of the app.</p><p>From here, the seller can create price rules based on which the seller’s product price will be calculated on the merchant’s store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Screenshot5-1200x454.png" alt="square up"></p><p>Clicking the <strong>Connector Price Rule</strong>, afterward, the seller needs to enable “Price Rule” status and select the options as increase/decrease price,</p><p>the price will be changed by a fixed amount or a percentage amount, enter the amount that needs to be changed.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Price-Rule-%E2%80%A2-Multivendor-MarketPlace-1121x1024.png" alt="price rule"></p><p>Enable the checkbox to update the already synced product’s price at the merchant’s store as per the price rule created.</p><p>As shown above, through this way, sellers can create price rules from their respective seller panels based on which product price of the seller’s POS will be calculated at the merchant’s store.</p><h3 id="sync-orders" tabindex="-1">Sync Orders <a class="header-anchor" href="#sync-orders" aria-label="Permalink to &quot;Sync Orders&quot;">​</a></h3><p>Orders can now be created in Seller’s Squareup through the Squareup Connector feature app.</p><p>You can choose if you want to create an order on the seller’s Squareup Store or not. For this, you need to visit the admin panel&gt;&gt;Connector Configuration&gt;&gt;Enable <strong>Sync Order</strong> tab.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/screenshot_1715166796720-1200x606.webp" alt="sync orders"></p><p>As soon as you enable this tab, you will get the option to choose if you want to sync customer data related to the order or not.</p><p>Also, you can restock inventory in the seller&#39;s store when an order is refunded on the admin store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/squareup-1200x568.webp" alt="sync"></p><p>This way, you can sync the customer details related to the order with the seller’s store and also restock the inventory when the order is refunded on the admin store.</p><h2 id="demo-details" tabindex="-1">Demo Details <a class="header-anchor" href="#demo-details" aria-label="Permalink to &quot;Demo Details&quot;">​</a></h2><p>Follow the below link to use the demo of Multi-vendor Marketplace app:</p><p><a href="https://multivendor-marketplace-5.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com/</a></p>',133)])])}const d=t(n,[["render",l]]);export{g as __pageData,d as default};
